/* Parses an AT line command into its components.
 *
 * @param {string} line - The AT command line to parse.
 * @returns {Object} An object containing the command with operation and an array of parameters.
 *                 - commandWithOp: The command with operation (e.g., "AT+CMGS=").
 *                 - params: An array of parameters (e.g., ["1234567890", "Hello"]).
 */
function parseAtCommand(line) {
    const match = line.match(/[?:=]/);
    if (!match) return { commandWithOp: line, params: [] };

    const index = match.index;
    const commandWithOp = line.slice(0, index + 1); // include the matched symbol
    const paramPart = line.slice(index + 1);

    const params = [];
    let current = '';
    let inQuotes = false;

    for (let i = 0; i < paramPart.length; i++) {
        const char = paramPart[i];

        if (char === '"') {
            inQuotes = !inQuotes;
            current += char;
        } else if (char === ',' && !inQuotes) {
            params.push(current.trim());
            current = '';
        } else {
            current += char;
        }
    }

    if (current) {
        params.push(current.trim());
    }

    return { commandWithOp, params };
}
